import React, { useState } from 'react';
import './App.css';
import { getList } from './Services/ListService'

function App() {
  const [list] = useState(true);
  return (
    <div className="GroceryList">
      <header className="Header">
        <h1>Grocery List</h1>
      </header>
      <div className="MainContent">
        <ul className="List">
          <li>Chicken wings</li>
          <li>Milk</li>
        </ul>
      </div>
    </div>
  );
}

export default App;
